// src/pages/HealthWellnessApps.js
import React from 'react';

const HealthWellnessApps = () => {
    return (
        <div>
            <h2>Health & Wellness Apps</h2>
            <p>Learn about apps that help manage health and wellness effectively.</p>
        </div>
    );
};

export default HealthWellnessApps;
